(window.webpackJsonpsmartcharts=window.webpackJsonpsmartcharts||[]).push([[10],{313:function(e){e.exports=JSON.parse('{"[symbol] feed is delayed by [delay] minutes":"Strumień [symbol] jest opóźniony o [delay] min.","[symbol] market is now opened.":"Rynek [symbol] jest teraz otwarty.","[symbol] market is presently closed.":"Rynek [symbol] jest obecnie zamknięty.","A technical momentum indicator that compares a security\'s closing price to its price range over a given time period. The oscillator\'s sensitivity to market movements can be reduced by adjusting the time period or by taking a moving average of the result.":"Techniczny wskaźnik dynamiki, który porównuje cenę końcową papieru wartościowego z zakresem jego cen w danym okresie czasowym. Czułość oscylatora na ruchy rynkowe można zmniejszyć, dostosowując okres czasu lub uwzględniając średnią kroczącą uzyskanych wyników.","Active":"Aktywne","Add":"Dodaj","Add new template":"Dodaj nowy szablon","Add new templates":"Dodaj nowe szablony","All drawings":"Wszystkie szkice","already exists.":"już istnieje.","Area":"Obszar","Available only for \\\\\\"Area\\\\\\" chart type.":"Dostępne tylko dla wykresu typu \\\\\\"Obszar\\\\\\".","Available only for non-tick time intervals.":"Dostępne tylko dla interwałów czasowych nie opartych na tickach.","Bill Williams introduced the Alligator indicator in 1995. The Alligator is as much a metaphor as it is an indicator. It consists of three lines, overlaid on a pricing chart, that represent the jaw, the teeth and the lips of the beast, and was created to help the trader confirm the presence of a trend and its direction. The Alligator indicator can also help traders designate impulse and corrective wave formations, but the tool works best when combined with a momentum indicator.":"W 1995 r. Bill Williams przedstawił wskaźnik Aligatora. Aligator jest zarówno metaforą, jak i wskaźnikiem. Składa się z trzech linii, nałożonych na wykres cen i reprezentujących szczękę, zęby i wargi aligatora. Wskaźnik został stworzony, aby pomóc inwestorom zaobserwować obecność i kierunek trendu. Wskaźnik Aligatora może również pomóc inwestorom w wyznaczeniu bodźca i tworzenia fali korekcyjnej, ale narzędzie to sprawdza się najlepiej w połączeniu ze wskaźnikiem pędu.","Bollinger Bands can be used to measure the highness or lowness of the price relative to previous trades.":"Wstęg Bollingera można używać w celu określenia, czy cena jest wysoka czy niska w porównaniu do poprzednich zakładów.","Box Size":"Rozmiar ramki","Cancel":"Anuluj","Candle":"Świeca","Channel [num]":"Kanał [num]","Chart data is not available for this symbol.":"Dane wykresowe są niedostępne dla tego symbolu.","Chart types":"Rodzaje wykresów","Charts":"Wykresy","Clear all":"Wyczyść wszystko","CLOSED":"ZAMKNIĘTE","Color":"Kolor","Continuous":"Ciągła","Continuous [num]":"Ciągle [num]","CSV":"CSV","Dark":"Ciemny","day":"dzień","days":"dni","Developed by Larry Williams, Williams %R is a momentum indicator that is the inverse of the Fast Stochastic Oscillator. Also referred to as %R, Williams %R reflects the level of the close relative to the highest high for the look-back period.":"Wskaźnik dynamiki Williams %R, stworzony przez Larry\'ego Williamsa, jest wskaźnikiem odwrotnym do oscylatora stochastycznego szybkiego. Wskaźnik ten, zwany również wskaźnikiem %R, odzwierciedla poziom ceny zamknięcia w stosunku do maksymalnej ceny w ostatnim okresie.","Developed by Tushar Chande in 1995, Aroon is an indicator system that determines whether a stock is trending or not and how strong the trend is. There are two separate indicators: Aroon-Up and Aroon-Down. A 25-day Aroon-Up measures the number of days since a 25-day high. A 25-day Aroon-Down measures the number of days since a 25-day low.":"System wskaźników Aroon został opracowany przez Tushara Chande w 1995 r. Wskazuje, czy dany instrument finansowy znajduje się w trendzie oraz jaka jest siła wskazywanego trendu. Istnieją dwa oddzielne wskaźniki: Aroon-Up oraz Aroon-Down. 25-dniowy wskaźnik Aroon-Up mierzy liczbę dni od momentu, gdy wskaźnik osiągnął szczyt. Z kolei 25-dniowy wskaźnik Aroon-Down mierzy liczbę dni od momentu spadku.","Display data for a specific date and time":"Wyświetl dane dla określonej daty i godziny","Display remaining time for each interval":"Wyświetl pozostały czas dla każdego interwału","Display the highest and lowest spot price":"Wyświetl najwyższą i najniższą cenę spot","Done":"Gotowe","Download":"Pobierz","Drawing tools":"Narzędzia do rysowania","Favorites":"Ulubione","Fib Fan [num]":"Fib Fan [num]","Fractals are indicators on candlestick charts that identify reversal points in the market. Traders often use fractals to get an idea about the direction in which the price will develop. A fractal will form when a particular price pattern happens on a chart.":"Fraktale, czyli wskaźniki Fractal na wykresach świecowych, wskazują punkty zwrotne na rynku. Gracze często posługują się fraktalami, aby zorientować się w którym kierunku będzie kształtować się cena. Fraktale tworzą się, gdy na wykresie występuje określona formacja cenowa.","H":"W","Highest and lowest spot":"Najwyższa i najniższa cena spot","Historical data mode":"Tryb danych historycznych","Hollow":"Pusty","Horizontal [num]":"Poziomo [num]","hour":"godzina","hours":"godzin(y)","Indicators":"Wskaźniki","Interval duration":"Czas trwania interwału","Kagi":"Kagi","L":"N","Language":"Język","Last digits stats for latest 1000 ticks on":"Statystyki końcowych cyfr dla ostatnich 1000 ticków dla rynku","Light":"Jasny","Line [num]":"Linia [num]","Line Break":"Podział linii","MACD is a trading indicator used in technical analysis of stock prices. It is supposed to reveal changes in the strength, direction, momentum, and duration of a trend in a stock\'s price.":"Wskaźnik MACD (Moving Average Convergence/Divergence) jest używany w analizie technicznej cen akcji. Ma on wskazywać siłę, kierunek, dynamikę oraz czas trwania trendu na rynku cen akcji.","Markets":"Rynki","minute":"minuta","minutes":"minuty","Momentum":"","Moving averages":"","Network status":"Status sieci","No results for":"Brak wyników dla","OHLC":"OHLC","Opens in:":"Otwarcie za:","Others":"","Overwrite":"Nadpisz","Platform settings":"Ustawienia platformy","PNG":"PNG","Point & Figure":"Punkt i figura","Price Lines":"Linie ceny","Range":"Zakres","Range Bars":"Słupki zakresu","Ray [num]":"Promień [num]","Rectangle [num]":"Prostokąt [num]","Renko":"Renko","Reset":"Reset","Result":"Wynik","Retrieving Chart Data...":"Pobieranie danych wykresu...","Retrieving Chart Engine...":"Pobieranie silnika wykresu...","Retrieving Market Symbols...":"Pobierania symboli rynkowych...","Retrieving Trading Times...":"Pobieranie godzin handlu...","Reversal":"Odwrotność","Reversal Percentage":"Procent odwrotny","Right click to delete":"Kliknij prawym przyciskiem, aby usunąć","Right click to manage":"Kliknij prawym przyciskiem, aby zarządzać","Saved templates":"Zapisane szablony","Search...":"Wyszukaj...","Select language":"Wybierz język","Select theme":"Wybierz motyw","Settings":"Ustawienia","Size":"Wielkość","Streaming for [symbol] is not available due to license restrictions":"Z powodu ograniczeń licencyjnych przesyłanie strumieniowe dla [symbol] jest niedostępne","Templates":"Szablony","The Average Directional Movement Index index (ADX) was developed in 1978 by J. Welles Wilder as an indicator of trend strength in a series of prices of a financial instrument ADX will range between 0 and 100. Generally, ADX readings below 20 indicate trend weakness, and readings above 40 indicate trend strength.":"Wskaźnik ADX (Average Directional Movement Index) został stworzony w 1978 r. przez J. Wellesa Wildera jako wskaźnik siły trendu w przypadku serii cen instrumentu finansowego. Wskaźnik ten ma rozpiętość od 0 do 100. Wartości ADX poniżej 20 wskazują na słabnięcie trendu, a wartości powyżej 40 na wzrost jego siły.","The Awesome Oscillator is an indicator used to measure market momentum. AO calculates the difference of a 34 Period and 5 Period Simple Moving Averages. The Simple Moving Averages that are used are not calculated using closing price but rather each bar\'s midpoints. AO is generally used to affirm trends or to anticipate possible reversals.":"Oscylator „Awesome” jest wskaźnikiem mierzącym dynamikę rynku. Oblicza on różnicę 34-okresowej prostej średniej kroczącej oraz 5-okresowej średniej kroczącej. W przypadku prostych średnich kroczących branych tu pod uwagę nie uwzględnia się ceny zamknięcia lecz poszczególne punkty średnie. Wskaźnik AO stosuje się do potwierdzania trendów lub przewidywanie ich możliwych zmian.","The Commodity Channel Index (CCI) is a versatile indicator that can be used to identify a new trend or warn of extreme conditions.":"Indeks CCI (Commodity Channel Index) to uniwersalny wskaźnik, który może być stosowany do przewidywania nowych trendów i ostrzegania przed ekstremalnymi warunkami rynkowymi.","The Detrended Price Oscillator (DPO) helps to identify price cycles without the influence of short- and long-term trends. The DPO compares a simple moving average to a historical pricenear the middle of a specified period. It also shows the peaks and drops over that particular period, making it easier to predict buy points.":"Beztrendowy oscylator cenowy pomaga identyfikować cykle cenowe i nie uwzględnia krótkoterminowych i długoterminowych trendów. Oscylator porównuje prostą średnią kroczącą do ceny historycznej zbliżonej do środka określonego okresu. Pokazuje również wzrosty i spadki w określonym okresie, dzięki czemu ułatwia przewidywanie punktów zakupu.","The Donchian Channel is an indicator used in market trading developed by Richard Donchian. It is formed by taking the highest high and the lowest low of the last n periods. The area between the high and the low is the channel for the period chosen.":"Kanał Donchiana jest wskaźnikiem handlowym stworzonym przez Richarda Donchiana. Uwzględnia najwyższą i najniższą cenę w określonej liczbie ostatnich okresów. Obszar między ceną niską a wysoką jest kanałem dla wybranego okresu.","The Gator Oscillator helps to detect trend changes in the market price. Based on the Alligator indicator, the Gator plots 2 histograms on either side of the zero line. The sleeping phase (absence of a trend) is when the bars on both sides are red. The awakening phase (formation of a trend) is when there are red and green bars on both sides. When there are green bars on both sides, it indicates the eating phase (trend strengthening). A solitary red bar appearing after the eating phase indicates the beginning of the sated phase (trend approaching its end).":"Oscylator Gator pomaga wykryć trendy zmian cen rynkowych. W oparciu o wskaźnik Aligatora oscylator Gator tworzy 2 histogramy po obu stronach linii zero. Faza uśpienia (brak trendu) występuje, gdy słupki po obu stronach są czerwone. Fazę przebudzenia (tworzenie się trendu) charakteryzują czerwone i zielone słupki po obu stronach. Gdy po obu stronach występują zielone słupki, wówczas mówimy o fazie polowania (umacnianie się trendu). Pojedynczy czerwony słupek pojawiający się po fazie polowania oznacza początek fazy nasycenia (trend zbliża się do swojego końca).","The Ichimoku Cloud, also known as Ichimoku Kinko Hyo, is a versatile indicator that defines support and resistance, identifies trend direction, gauges momentum and provides trading signals. Ichimoku Kinko Hyo translates into “one look equilibrium chart”.":"Chmura Ichimoku, zwana też Ichimoku Kinko Hyo, to uniwersalny wskaźnik, który określa poziom wsparcia i oporu, sygnalizuje kierunek trendu, mierzy momentum i wskazuje sygnały inwestycyjne. Ichimoku Kinko Hyo tłumaczy się jako „wykres równowagi, na który wystarczy rzucić okiem”.","The Moving Average (MA) helps to identify the overall market trend by filtering out short-term price fluctuations. Using historical data, it calculates the average price over a specific period and plots a line on the chart. If the MA line moves upwards, it’s an indicator of an uptrend, a downtrend if it moves downwards. A buy signal occurs when the price moves above the MA line.":"Średnia krocząca (MA) pomaga określić ogólny trend rynkowy, filtrując krótkoterminowe odchylenia cen. Korzystając z danych historycznych, średnia oblicza średnią cenę w danym okresie i nanosi linię na wykres. Jeśli MA wznosi się, wskazuje to na trend wzrostowy, natomiast jeśli opada, wskazuje na trend spadkowy. Jeśli cena znajduje się powyżej linii MA, jest to sygnał do zakupu.","The Moving Average Envelope (MAE) helps to identify strong price movement that indicates the start of a trend. The MAE creates a moving average line as well as 2 bands around it. In theory, when the market price touches the upper or lower bands, a trend reversal will occur, indicating a buy signal.":"Średnia krocząca Envelope (MAE) wskazuje silne zmiany cen oznaczające początek trendu. MAE tworzy linię średniej kroczącej i 2 wstęgi wokół niej. Teoretycznie, jeśli cena rynkowa dotknie wyższej lub niższej wstęgi, nastąpi odwrócenie trendu, co stanowi sygnał do zakupu.","The parabolic SAR is calculated almost independently for each trend in the price. When the price is in an uptrend, the SAR emerges below the price and converges upwards towards it. Similarly, on a downtrend, the SAR emerges above the price and converges downwards. At each step within a trend, the SAR is calculated one period in advance.":"Wskaźnik SAR jest obliczany oddzielnie dla każdego trendu ceny. Gdy cena jest w trendzie wzrostowym, SAR pojawia się poniżej poziomu ceny i podąża w górę w stronę ceny. Z kolei w trendzie spadkowym, SAR pojawia się powyżej poziomu ceny i podąża w dół. Na każdym etapie trendu wskaźnik SAR jest obliczany jeden okres wprzód.","The Price Rate-of-Change (ROC) indicator displays the difference between the current price and the price x-time periods ago. The difference can be displayed in either points or as a percentage.":"Wskaźnik zmian ceny (ROC) przedstawia różnicę między obecną wysokością ceny a jej wysokością w poprzednich okresach wyrażoną w ujęciu procentowym lub punktowym.","The Rainbow Moving Average (RMA) displays several moving average lines simultaneously. When the lines intersect, it’s an indicator of price reversal and the angle of the lines are helpful to predict the trend strength. The steeper the curve, the stronger the trend. When the price crosses the moving average lines from below, it signals an upward trend. When the price crosses the moving average lines from above, it signals a downward trend. The RMA is easier to use compared to using several different moving average indicators at once.":"Tęczowa średnia krocząca (RMA) wyświetla kilka linii średnich kroczących jednocześnie. Przecięcie się linii oznacza zmianę ceny, a końce linii pomagają przewidzieć siłę trendu. Bardziej stroma krzywa oznacza silniejszy trend. Gdy cena przecina linie średniej kroczącej od dołu, oznacza to trend wzrostowy. Gdy cena przecina linie średniej kroczącej od góry, jest to oznaka trendu spadkowego. RMA jest prostsza w użyciu w porównaniu z innymi wskaźnikami średnich kroczących.","The Relative Strength Index (RSI) was published by J. Welles Wilder. The current price is normalized as a percentage between 0 and 100. The name of this oscillator is misleading because it does not compare the instrument relative to another instrument or set of instruments, but rather represents the current price relative to other recent pieces within the selected lookback window length.":"Wskaźnik względnej siły (RSI) został opracowany przez J. Wellesa Wildera. Obecna cena przedstawiana jest jako wartość procentowa między 0 a 100. Nazwa tego wskaźnika jest myląca, gdyż nie porównuje on instrumentu z innym instrumentem lub zbiorem instrumentów finansowych, lecz odzwierciedla obecną cenę w odniesieniu do niedawnych cen w wybranym przeszłym okresie.","The Stochastic Momentum Index (SMI) helps to identify overbought or oversold conditions in the market and to predict bearish or bullish trends. It calculates the distance between the current closing price and the median of the high/low range, and displays 2 lines on the chart: the first (known as %K) represents the price movement while the second (known as %D) is a moving average of the first line. If the closing price is higher than the median of the high/low range, the SMI returns a positive value. If the closing price is lower than the average price, a negative value is returned. Values above 40 indicate a bullish trend while values below -40 indicate a bearish trend.":"Wskaźnik stochastyczny impetu (SMI) pomaga rozpoznać stan wykupienia lub wyprzedania na rynku i przewidzieć trendy wzrostowe i spadkowe. Wskaźnik oblicza odległość między obecną ceną zamknięcia i medianę przedziału wysokich i niskich wartości, i przedstawia 2 linie na wykresie: pierwsza (zwana %D) to średnia krocząca pierwszej linii. Jeśli cena zamknięcia jest wyższa od mediany przedziału wysokich i niskich wartości, SMI zwraca wartość dodatnią. Jeśli cena zamknięcia jest niższa niż średnia cena, zwraca wartość ujemną. Wartości powyżej 40 wskazują trend wzrostowy, a wartości poniżej -40 trend spadkowy.","Themes":"Motywy","There are no favorites yet.":"Brak ulubionych.","tick":"tick","Tick interval only available for \\\\\\"Area\\\\\\" Chart type.":"Interwał ticku jest dostępny tylko dla wykresu typu \\\\\\"Obszar\\\\\\".","Time interval":"Interwał czasowy","Trend":"","Trend [num]":"Trend [num]","Try checking your spelling or use a different term":"Sprawdź pisownię lub użyj innego pojęcia","Underlying Assets":"Aktywa bazowe","Up to 2 active indicators allowed.":"","Up to 5 active indicators allowed.":"Dozwolonych jest maksymalnie 5 aktywnych wskaźników.","Vertical [num]":"Pionowo [num]","Volatility":"","Would you like to overwrite it?":"Chcesz go nadpisać?","You have no active drawings yet.":"Nie masz jeszcze żadnych aktywnych szkiców.","You have no active indicators yet.":"Nie masz jeszcze żadnych aktywnych wskaźników.","You have no saved templates yet.":"Nie masz jeszcze żadnych zapisanych szablonów.","Zig Zag helps to identify trend reversals and filters out relatively small price movements by determining the support and resistance levels of the market. It accepts a percentage of deviation as the input and displays a line if the price change is larger than the percentage of deviation. Zig Zag ignores any sideways movement and is useful to filter out “market noise”.":"Zig Zag pomaga zidentyfikować odwrócenie trendu i filtruje relatywnie małe zmiany ceny poprzez określanie poziomu wsparcia i oporu rynku. Akceptuje procent odchylenia jako dane wejściowe i wyświetla linię, jeśli zmiana ceny jest większa niż ten procent odchylenia. Zig Zag ignoruje jakiekolwiek odchylenia i jest przydatny do eliminowania zakłóceń rynkowych.","Zoom in":"Powiększ","Zoom out":"Pomniejsz"}')}}]);
